New build AR-15.

Code Red multi-caliber lower receiver;
Flat top upper receiver with M4 feed ramps - Jolly Roger laser engraved;
DSArms 5.56x45 NATO 1x9 16" barrel with M4 feed ramps;
Standard A-2 bird cage flash hider;
Standard A-2 front sight;
Removable carrying handle with rear sight;
MilSpec M-16 bolt carrier group;
All MilSpec internals;
Adjustable stock;
Standard pistol grip;
Standard handguard.

One 30-round magazine.
